import './particle.css'
import Particles from 'react-particles-js'

function Particle(){
    return (
        <div>
            <Particle id="particle" 
                params={{
                    particles: {
                        number: {
                            value: 3,
                            density: {
                                enable: true,
                                value_area: 1000
                            }
                        },
                        color: {
                            value: '#fff'
                        },
                        size: {
                            value: 7,
                            random: true,
                            anim: {
                                anim: true,
                                speed: 3
                            }
                        },
                        linked_linked: {
                            enable: true
                        }
                    }
                }}
                />
        </div>
    );
  }

  export default Particle;
